svg.script:
function clicked(s)
{
	//need to get the actors to filter
	//look for all the nodes that have the actor name s, and set the
	//visibility of these nodes as hidden if it doesnt have 
	var t = 'node';
	var i = 0;
	var rel_actors = '';
	var can_rel_actors = '';
	for(i = 0 ; i < 400 ; i++)
	{
		idnode = t + i;
		var node = document.getElementById(idnode);
		if (node != null)
		{
			var elms = node.getElementsByTagName('*');
			var j = 0;
			var match = 0;
			for(j = 0 ; j < elms.length ; j++)
			{
				if (elms[j].firstChild != null && elms[j].nodeName=='text')
				{
					actor = elms[j].firstChild.nodeValue;
					if (actor.toLowerCase().toString() == s.toString())
					{
						match = 1;
					}
					can_rel_actors += '<li>' + actor + "</li>";
					// here actor will be updated in the right frame

				}
			}
			if (match == 1)
				rel_actors += can_rel_actors;
			can_rel_actors = '';
			if (match == 0)
				node.style.visibility = 'hidden';
		}
	}
	parent.document.getElementById('down_right').contentWindow.callclicked(rel_actors);
	//pass over all the edges and figure out if they 
	//connect any node that is hidden and delete it
	//currently the naive approach is to iterate over all edges,
	//figure out which 2 nodes this edge joins, then iterate over
	//all nodes and figure out if this node has the same id. if so, 
	//remove this edge. continue
	i = 0;
	t = 'edge';
	for(i = 0 ; i < 800 ; i++)
	{
		var idedge = t + i;
		var edge = document.getElementById(idedge);
		match = 0;
		if (edge != null)
		{
			var elms = edge.getElementsByTagName('*');
			var j = 0;
			var match = 0;
			for(j = 0 ; j < elms.length ; j++)
			{
				if (elms[j].firstChild != null && elms[j].nodeName=='text')
				{
					eactor = elms[j].firstChild.nodeValue;
					if (eactor.toLowerCase().toString() == s.toString())
					{
						match = 1;

					}
				}
			}
			if (match == 0)
				edge.style.visibility = 'hidden';
		}
	}
}
